import React, {SyntheticEvent, useState } from 'react';
import '../../styles/index.scss';
import { useNavigate } from 'react-router-dom';
import CreateAccountButton from '../../components/atoms/Buttons/CreateAccountButton';
import PasswordRegisterInput from '../../components/atoms/inputs/PasswordRegisterInput';
import EmailRegisterInput from '../../components/atoms/inputs/EmailRegisterInput';
import NameRegisterInput from '../../components/atoms/inputs/NameRegisterInput';
import SurnameRegisterInput from '../../components/atoms/inputs/SurnameRegisterInput';

const RegisterPage = () => {

  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [birthday, setBirthday] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  const handleName = (name :string) => {
    setName(name);
  };

  const handleSurname = (surname :string) => {
    setSurname(surname);
  };

  const handleEmail = (email :string) => {
    setEmail(email);
  };

  const handlePassword = (password :string) => {
    setPassword(password);
  };

  const handleConfirmPassword = (password :string) => {
    setConfirmPassword(password);
  };

  const submit = async (e: SyntheticEvent) =>{
    e.preventDefault();
    if(password === confirmPassword) {
      const response = await fetch('http://localhost:8000/api/register', {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({
          email,
          password,
          name,
          surname,
          birthday
        })
      })
      if(response.ok){
        return navigate('/register_successful');
      }
      else{
        console.error('Error', response.status, response.statusText);
        return setMessage('Error');
      }
    }
    else {
      return setMessage('Passwords do not match');
    }
  }

  return (
    <div>
      <form onSubmit={submit}>
        <h1>Register</h1>

        <NameRegisterInput onNameChange={handleName} />
        <SurnameRegisterInput onSurnameChange={handleSurname} />

        <input 
          type='date' 
          className='register-input-form' 
          required
          onChange={e => setBirthday(e.target.value)}
        />

        <EmailRegisterInput onEmailChange={handleEmail} />
        <PasswordRegisterInput onPasswordChange={handlePassword} />
        <PasswordRegisterInput onPasswordChange={handleConfirmPassword} />
        <CreateAccountButton />
      </form>
      {message && <div>{message}</div>}
    </div>
  );
}

export default RegisterPage;
